import b9 from "./Assets/fan/b9.png";
import c1 from "./Assets/fan/c1.png";
import c2 from "./Assets/fan/c2.png";
import c3 from "./Assets/fan/c3.png";
import c4 from "./Assets/fan/c4.png";
