import d8 from "./Assets/fan/d8.png";
import d9 from "./Assets/fan/d9.png";
import gd from "./Assets/fan/gd.png";
import rd from "./Assets/fan/rd.png";
import wd from "./Assets/fan/wd.png";
import e from "./Assets/fan/e.png";
import s from "./Assets/fan/s.png";
import w from "./Assets/fan/w.png";
import n from "./Assets/fan/n.png";
import Navbar from "./navbar.js";
import React, { Component } from "react";
import _ from "lodash";

const tiles = [
  b1,
  b2,
  b3,
  b4,
  b5,
  b6,
  b7,
  b8,
  b9,
  c1,
  c2,
  c3,
  c4,
  c5,
  c6,
  c7,
  c8,
  c9,
  d1,
  d2,
  d3,
  d4,
  d5,
  d6,
  d7,
  d8,
  d9,
  gd,
  rd,
  wd,
  e,
  s,
  w,
  n,
];

let hand = [];

function makeRandomFan() {
  // will return two items randomly from the array using lodash
  hand = _.sampleSize(tiles, 14);
  hand = hand.sort();
}

class renderFan {
  return() {
    <div className="fan">
      <div className="fanTiles">
        <img
          className="fanImg"
          src={hand[0]}
          alt="Single mahjong tile, part of this fan"
        />
        <img
          className="fanImg"
          src={hand[1]}
          alt="Single mahjong tile, part of this fan"
        />
        <img
          className="fanImg"
          src={hand[2]}
          alt="Single mahjong tile, part of this fan"
        />
        <img
          className="fanImg"
          src={hand[3]}
          alt="Single mahjong tile, part of this fan"
        />
        <img
          className="fanImg"
          src={hand[4]}
          alt="Single mahjong tile, part of this fan"
        />
        <img
          className="fanImg"
          src={hand[5]}
          alt="Single mahjong tile, part of this fan"
        />
        <img
          className="fanImg"
          src={hand[6]}
          alt="Single mahjong tile, part of this fan"
        />
        <img
          className="fanImg"
          src={hand[7]}
          alt="Single mahjong tile, part of this fan"
        />
        <img
          className="fanImg"
          src={hand[8]}
          alt="Single mahjong tile, part of this fan"
        />
        <img
          className="fanImg"
          src={hand[9]}
          alt="Single mahjong tile, part of this fan"
        />
        <img
          className="fanImg"
          src={hand[10]}
          alt="Single mahjong tile, part of this fan"
        />
        <img
          className="fanImg"
          src={hand[11]}
          alt="Single mahjong tile, part of this fan"
        />
        <img
          className="fanImg"
          src={hand[12]}
          alt="Single mahjong tile, part of this fan"
        />
        <img
          className="fanImg"
          src={hand[13]}
          alt="Single mahjong tile, part of this fan"
        />
      </div>
    </div>;
  }
}

class Quiz extends Component {
  render() {
    return (
      <div>
        <header>
          <Navbar />
        </header>
        <body className="mBody">
          <h1>Fan Quiz</h1>
          <h3>
            Practice recognizing fan by guessing how many points the displayed
            hand is worth.
          </h3>
          <renderFan />
          <button
            className="hollowButton"
            onClick={() => {
              makeRandomFan();
            }}
          >
            START
          </button>
        </body>
      </div>
    );
  }
}

export default Quiz;
